  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112227 includes biological,
  chemical, discrete sample, physical and profile data collected from HAKUREI MARU
  in the North Pacific Ocean and South Pacific Ocean from 1992-08-07 to 1992-10-05
  and retrieved during cruise NH92-2 and PACIFICA_49HG19920807. These data include
  ALKALINITY, AMMONIUM, CHLOROPHYLL A, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN,
  HYDROSTATIC PRESSURE, NITRATE + NITRITE CONTENT (CONCENTRATION), NITRITE, PHOSPHATE,
  SALINITY, SILICATE, WATER TEMPERATURE and pH. The instruments used to collect these
  data include CTD, Coulometer for DIC measurement and bottle. These data were collected
  by Yutaka W. Watanabe and Kimitoshi Ishikawa of National Institute for Resources
  and Environment as part of the PACIFICA_49HG19920807 data set.nnPACIFICA (PACIFic
  ocean Interior CArbon) was an international collaborative project for the data synthesis
  of ocean interior carbon and its related parameters in the Pacific Ocean. The North
  Pacific Marine Science Organization (PICES), Section of Carbon and Climate (S-CC)
  supported the project.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
